More Americans have health insurance today than ever before.

And after fighting for 50 years to give Medicare the power to negotiate lower prescription drug prices, we finally beat Big Pharma.

@KamalaHarris cast the tie-breaking vote.

From the time I was in the Senate, I worked tirelessly to give Medicare the power to negotiate lower drug prices. 

For years, Big Pharma blocked any progress.

@KamalaHarris and I finally beat Big Pharma. And we did it with no help from Republicans. https://t.co/8HOGP4hg4P

