Joe Biden signed all of our priority bills &amp; 
approved community projects.…

Two years ago today, Donald Trump’s Supreme Court overturned Roe v. Wade. 

@KamalaHarris and I will never stop fighting for reproductive freedom. Tune in as she delivers remarks.
 https://t.co/iiMlPaTM5K

Republicans, led by Donald Trump, are threatening access to abortion, contraception, and IVF.

It’s at odds with the majority of Americans.

@KamalaHarris and I will continue to fight to protect access to reproductive health care.

Drug companies have skyrocketed prices for asthma drugs in the United States. 

@BernieSanders called them out, and my administration is cracking down on these drug companies.

Now, three of the four largest companies are capping the cost of inhalers at $35. https://t.co/tGIzJr3CxQ

